@-moz-document domain("golem.de") {
@media (prefers-color-scheme: dark) {

    body {
        background: #222;
        color: #d7d7d7;
    }
    
    #header, #footer {
        background: unset;
    }
    
    #header {
        position: fixed;
        z-index: 1000;
        background-color: #000;
    }
    
    #gservices {
        padding-top: 80px;
        background-color: #131313;
    }

    #grandwrapper, #screen {
        border: 0px;
        background-color: #000;
    }
    
    #grandwrapper {
        padding-left: 10px;
        padding-right: 10px;
    }

    .head1, .head2, .head3, .head4 {
        color: #fff !important;
    }
    
    .head1 {
        color: #b1b1b1 !important;
    }
    
    .head2, .head3, .head4 {
        color: #e84d0e !important;
    }
       
    .icon-comments, .icon-video, .icon-audio {
        color: #b1b1b1 !important;
    }

    .list-articles li, .activity #large-forum li, .iqadlinetop, .forum #thread-list li, .forum #thread-detail li {
        border-top: solid 1px #5b5b5b;
    }
    
    .dli {
        border-top: solid 1px #5b5b5b !important;
    }
    
    .forum #thread-detail h3 strong, span.user {
        color: unset !important;    
    }
    
    #phorum div.information {
    border: unset !important;
    background-color: #584a47;
}
    
    a, .supplementary form.gservprg>input, aside form.gservprg>input {
        color: #e84d0e !important;
    }
    
    .golem-external-url {
        background: url("data:image/svg+xml,%3Csvg%20xmlns%3D%22http%3A//www.w3.org/2000/svg%22%20width%3D%2214%22%20height%3D%2214%22%20viewBox%3D%220%200%2024%2024%22%3E%3Cpath%20fill%3D%22%23e84d0e%22%20d%3D%22M14.016%203H21v6.984h-2.016V6.42L9.187%2016.22%207.78%2014.812l9.798-9.797h-3.563V3zm4.968%2015.984V12H21v6.984q0%20.797-.61%201.406t-1.405.61H5.015q-.843%200-1.43-.61T3%2018.984V5.014q0-.796.586-1.405T5.016%203H12v2.016H5.016v13.97h13.97z%22/%3E%3C/svg%3E") no-repeat 100% 60% transparent !important;
    }
    
    .toc__list, #comments, .threads {
        background: unset !important;
    }
    
    #comments, .threads {
        border: unset !important;
    }
    

    
    .g2 {
        display: none;
    }
    
    .g4 {
        width: 100%;
    }
    

}

    img {
        border-radius: 5px;
    }
}

@-moz-document domain("pub.dev") {
/*
 * Pallete taken from https://ethanschoonover.com/solarized/
 */

/* Provide solarized background and text colors for the main tags */
body, main, .site-header {
    background-color: #002b36;
}
.package-banner, select {
    background-color: #073642;
}
._banner-bg {
    background-image: none;
    background-color: #073642;
}
nav, p, h1, h2, h3, h4, h5, h6, li, .search-bar-options, .tooltip-dotted, .package-count {
    color: #839496;
}
a {
    color: #268bd2;
}
a:hover {
    color: #d33682;
}
select {
    color: #93a1a1;
}


/* Header navigation colours */
.sub-nav, .tooltip-content {
    background-color: #fdf6e3;
    color: #657b83;
}
.sub-nav > .link {
    color: #586e75;
}

/* Searchbar colours */
.search-bar {
    background-color: #002b36;
    border-color: #586e75;
}
.input {
    color: #2aa198;
}
.input::placeholder {
    color: #839496;
}

/*
 *   BEGIN SECTION: Package page
 */
/* These are the tags show just below the title. */
.package-tag {
    color: #2aa198;
    background-color: #073642;
}

/* Tabs */
.package-tabs > .tab {
    color: #839496;
}
.package-tabs > .tab.-active {
    color: #93a1a1;
    border-bottom-color: #268bd2;
}

/* Color for the publish date shown under the title. */
.package-header > .metadata {
    color: #586e75;
}

.package-container > .sidebar {
    background-color: #073642;
    border-radius: 8px;
    border-color: #586e75;
}

/* Add rounded corners to code blocks missing them (looking at you "Installing" tab) */
code {
    border-radius: 4px;
}

/* Author name/email */
.author {
    color: #2aa198;
}
/*
 *   End SECTION: Package page
 */

/*
 *   BEGIN SECTION: Home and search results pages
 */
.landing-page-title, .listing-page-title {
    color: #859900;
}
.list-item > .description {
	color: #839496;    
}
.list-item:hover{
    /* This color breaks the solarized scheme so as to avoid blending with the package tags background. */
    background-color: #002f3d;
}

.list-filters {
    border-color: #586e75;
}
.list-filters > .filter {
    background-color: #073642;
    color: #2aa198;
    border-color: #586e75;
}
.list-filters > .filter.-active {
    background-color: #002b36;
    color: #d33682;
}
.score-box > .new {
    color: #fdf6e3;
    background-color: #b58900;
}
.pagination > li {
    background-color: #073642;
    color: #2aa198;
    border-radius: 999px;
}
.pagination > li.-disabled {
    color: #93a1a1;
}
.pagination > li.-active {
    background-color: #2aa198;
    color: #fdf6e3;
}
/*
 *   END SECTION: Home and search results pages
 */
}

